import {GoogleLogin} from 'react-google-login'
import ReactDOM from "react-dom/client";

const clientId = '835121806973-tr90hm3cf2to99b48mljtcm98v99jrg1.apps.googleusercontent.com'


function Login() {
    const onSuccess = (res)=>{
        console.log("login Success, Current user: ", res.profileObj)
    }

    const onFailure = (res) =>{
        console.log("login Failed, res: ", res)
    }

    return ReactDOM.render(<div id={'signInButton'}>
        <GoogleLogin
            clientId={clientId}
            buttonText={"login"}
            onSuccess={onSuccess}
            onFailure={onFailure}
            cookiePolicy={'single_host_origin'}
            isSignedIn={true}
            />
    </div>)
}

export default Login
